        [color=#1b487e]███░███░░░░██░░░░[/color]

        [color=#1b487e]░██░████░░░██░░░░[/color]      [color=#57a343][head=3]   Бланк документа[/head][/color]

        [color=#1b487e]░░█░██░██░░██░█░░[/color]               [color=#57a343][head=3]НаноТрейзен[/head][/color]

        [color=#1b487e]░░░░██░░██░██░██░[/color] [color=#57a343][bold]      Шаттл "Орвилл"ЦК-НИО[/bold][/color]

        [color=#1b487e]░░░░██░░░████░███[/color]

        [color=#1b487e]=============================================[/color]
                      [color=#57a343][head=3]ЦЕЛЬ ИССЛЕДОВАТЕЛЬСКОГО
                   НАЗНАЧЕНИЯ
        ШАТТЛА "ОРВИЛЛ"[/head][/color] 
         [color=#1b487e]=============================================
        [/color]

                      [color=#006C51]Капитану следует внимательно выполнять следующую цель, а так же проинформировать экипаж шаттла.
                Ваша цель - утилизация и последующие изучение обломков шаттла группировки Синдиката, по нашим данным направляющийся к станции изучение биологического оружия. Экипажу следует быть бдительным и выполнять постепенную утилизацию, всё вооружение разрешается использовать при стычках с неизвестными угрозами, но с последующей телепортацией по средствам телепадов на СЦК. По возможности следует найти бортовой журнал шаттла с последующей доставкой на станции ЦК. Если конфликта можно избежать, то следует поступить с последующей защитой экипажа.
                Желаем хорошей работы, при успешной мисси команда будет награждена. Слава NT!

              При провале команда будет расформирована согласно договорённости от 13.05.3019г. Номер документа: ERY-928. А капитан будет отдан на суд совета глав. 

